import { ref } from 'vue'
import { defineStore } from 'pinia'

export const useUserStore = defineStore('user', () => {
  const count = ref(0)
  const fname = ref('User')
  const lname = ref('')
  function setFullName(newFname, newLname) {
    fname.value = newFname
    lname.value = newLname
  }

  return { count, fname, lname, setFullName}
})
